const ContactForm = ({ onInputName, onInputPhone, onInputContact }) => {
    return (
        <form action="form">
            <p>Name</p>
            <input type="text" onChange={onInputName} />
            <p>Phone</p>
            <input type="phone" onChange={onInputPhone} />
            <button type="button" onClick={onInputContact}>Add contact</button>
        </form>
    )
}

export default ContactForm;
